import "../App.css";
import React, { useState } from "react";

function Showinfo() {
  const [background, setBackground] = useState({
    backgroundImage: "url(/clearSky.jpg)",
  });

  return <div className="Showinfo" style={background}></div>;
}

export default Showinfo;
